// src/components/Categories.js
import React from 'react';
import './Categories.css';

const categories = [
  'Fiction',
  'Non-Fiction',
  'Science',
  'Technology',
  'History',
  'Biography',
  // Add more categories here
];

const Categories = () => {
  return (
    <div className="categories">
      <h2>Categories</h2>
      <ul>
        {categories.map((category, index) => (
          <li key={index}>{category}</li>
        ))}
      </ul>
    </div>
  );
};

export default Categories;
